u1_t E1B_code1[NUM_E1B_SATS][E1B_CODELEN];

struct E1BCODE {
    int sat_i, codep;

    E1BCODE(int prn) {
        int i;
        sat_i = prn-1;
        
        for (i=0; i < E1B_CODELEN; i++) {
            int nib = i/4;
            char c = e1b_strings[sat_i][nib];
            int n = (c >= '0' && c <= '9')? (c - '0') : (c - 'A' + 10);
            int bit = 3 - (i%4);
            E1B_code1[sat_i][i] = (n >> bit) & 1;
        }
        
        codep = 0;
    }

    int Chip() {
        return E1B_code1[sat_i][codep];
    }

    void Clock() {
        codep++;
        if (codep >= E1B_CODELEN)
            codep = 0;
    }
};
